import Product from "./Product";

function Product_List() {
    return (
        <div className="products">
            <Product name="Air Condition" price="39000" url="https://www.lg.com/levant_en/images/AC/features/rac-normal-ac-mea-white-01-fast-cooling-mobile.jpg"/>
            <Product name="Refrigerator" price="26000" url="https://www.reliancedigital.in/medias/Samsung-RF87A9770SG-Refrigerators-492391820-i-2-1200Wx1200H?context=bWFzdGVyfGltYWdlc3w2NDM4N3xpbWFnZS9qcGVnfGltYWdlcy9oODQvaDI5Lzk2NTE2OTY1MzM1MzQuanBnfDZkMmY5YWQ3YTgzNGY4OGE4MTBhODVjNTY3MmM2M2M5OTU0NDliNGUwZGFiNmU4ODEwMDAyNTM0MWIyZjQ3MDY"/>
            <Product name="LED TV" price="18000" url="https://truvison.com/wp-content/uploads/2016/09/1.2-20230511-152130.jpg"/>
        </div>
    )
}

export default Product_List();
